webpackJsonp([0xf83c1f9db03f],{438:function(A,a){A.exports={data:{site:{siteMetadata:{title:"ourbucketl.ist",author:"Dan Rose & Sophie Mellissa"}},markdownRemark:{id:"C:/Users/danja/OneDrive/Documents/GitHub/ourbucketl.ist/src/pages/lake-titicaca/index.md absPath of file >>> MarkdownRemark",html:'<p><em>Local communities believe that the shape of the lake depicts that of a puma hunting the rabbit. Thus the name, Titicaca, comes from the word “Titi Khar’ka” meaning Rock of the Puma in Aymara (a local indigenous language).</em></p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1rem"\n          >\n            <iframe frameborder="0" src="//www.dailymotion.com/embed/video/xynf5d" allowfullscreen allow="autoplay" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>Donald Duck visits Lake Titicaca</p>\n<h2>Isla Del Sol</h2>\n<p>We booked this excursion for convenience with Bolivia Hop so that we could leave Copacabana the same day. The boat picked us up at 13:00 and after an hour or so we were dropped off an a remote pier on Isla Del Sol. We were told the hike was around an hour to Yumani pier, where the boat would pick us back up. The driver offered no explanation or history of the island.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/inca-temple-64b147013aa0c4dd6c761e5a345a394c-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Inca Temple"\n        title="Inca Temple"\n        src="/static/inca-temple-64b147013aa0c4dd6c761e5a345a394c-769ec.jpg"\n        srcset="/static/inca-temple-64b147013aa0c4dd6c761e5a345a394c-d9ef2.jpg 225w,\n/static/inca-temple-64b147013aa0c4dd6c761e5a345a394c-ac97c.jpg 450w,\n/static/inca-temple-64b147013aa0c4dd6c761e5a345a394c-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>As we climbed up the steep steps, we first saw some Inca ruins. The Inca’s believed that the sun god was born on this island, hence the name Isla Del Sol, or island of the sun. There are no roads or vehicles on the island and 800 families live there. Their main income is farming, followed by fishing and tourism. We saw some women and children on our hike along the island, they had Llama’s and asked if we wanted to pay for photos. The best part of the island were the fantastic views of Lake Titicaca and other nearby islands.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/inca-stairs-de7cecc7cf15e07b94e8fcd7c6c48818-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Inca Stairs"\n        title="Inca Stairs"\n        src="/static/inca-stairs-de7cecc7cf15e07b94e8fcd7c6c48818-769ec.jpg"\n        srcset="/static/inca-stairs-de7cecc7cf15e07b94e8fcd7c6c48818-d9ef2.jpg 225w,\n/static/inca-stairs-de7cecc7cf15e07b94e8fcd7c6c48818-ac97c.jpg 450w,\n/static/inca-stairs-de7cecc7cf15e07b94e8fcd7c6c48818-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Puno</h2>\n<p>We were initially going to do a day trip from Puno to Isla Uros and Taquile Island. However, after a day in Copacabana we didn’t get to Puno until 21:00 and the trips collected at 06:00. So, we decided to use Puno as an opportunity for some rest in our <a href="https://www.huaytusivepuno.com/">Huaytusive Hotel</a>, following a tough few days in Bolivia and we opted for a half day trip to Islas Flotantes De Los Uros.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/puno-f98f556e56452755df29557206dcc78c-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Puno"\n        title="Puno"\n        src="/static/puno-f98f556e56452755df29557206dcc78c-769ec.jpg"\n        srcset="/static/puno-f98f556e56452755df29557206dcc78c-d9ef2.jpg 225w,\n/static/puno-f98f556e56452755df29557206dcc78c-ac97c.jpg 450w,\n/static/puno-f98f556e56452755df29557206dcc78c-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We had a wander around Puno which is at 3,827 metres, but it is quite small and there wasn’t a lot to see. We were just about ready to stomach some beers again, so  we headed to a bar to watch the Liverpool vs Roma Champions League Semi Final, first leg. The game did not disappoint despite the best attempts of the staff at the bar, faffing with the televisions.</p>\n<h2>Islas Flotantes De Los Uros</h2>\n<p>We took a trip to <a href="https://en.wikipedia.org/wiki/Uru_people">Islas Flotantes De Los Uros</a> or the floating islands with our hotel as it was only S./25 (£5.60). It was very odd as we were rushed away by a woman into a taxi to the port. We were then handed over to a guy who walked us to the boat where everybody was waiting for us. The guide spoke in both English and Spanish but we couldn’t hear him very well due to the boat engine and his monotonous voice.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/floating-islands-eab471b03d541fc172afd561d639a6e4-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Floating Islands"\n        title="Floating Islands"\n        src="/static/floating-islands-eab471b03d541fc172afd561d639a6e4-769ec.jpg"\n        srcset="/static/floating-islands-eab471b03d541fc172afd561d639a6e4-d9ef2.jpg 225w,\n/static/floating-islands-eab471b03d541fc172afd561d639a6e4-ac97c.jpg 450w,\n/static/floating-islands-eab471b03d541fc172afd561d639a6e4-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>When we arrived to one of the islands there was a little boy waiting for us with his football, so as soon as we jumped off the boat and onto the island we had a quick kick around while we waited for the group to congregate. We never thought that we’d play football in the middle of a lake on a bunch of reeds. It was at this point that we took note upon how fascinating the islands actually were and how the islands seemed to move with the water and our footsteps.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/uru-island-b1d4fb371cc026fcf0078c7eaa136263-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Uru Island"\n        title="Uru Island"\n        src="/static/uru-island-b1d4fb371cc026fcf0078c7eaa136263-769ec.jpg"\n        srcset="/static/uru-island-b1d4fb371cc026fcf0078c7eaa136263-d9ef2.jpg 225w,\n/static/uru-island-b1d4fb371cc026fcf0078c7eaa136263-ac97c.jpg 450w,\n/static/uru-island-b1d4fb371cc026fcf0078c7eaa136263-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We were introduced to an Uru family who lived on the small island and the young male explained that the islands were constructed by numerous layers of criss-crossed reeds that grow in the shallows of the lake. He then proceeded to show us where they slept before selling us a couple of Llama key rings and a balsa boat ride to Isla Capital. The young Uros man referred to his boat as a ‘Mercedez Benz’. The boat was also made out of reeds and was pushed along by a speed boat as the little boy with his football sang ‘Row row row your boat’.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/balsa-boat-dd681df416a5af4cf1a62b22fb0e19d9-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Balsa Boat"\n        title="Balsa Boat"\n        src="/static/balsa-boat-dd681df416a5af4cf1a62b22fb0e19d9-769ec.jpg"\n        srcset="/static/balsa-boat-dd681df416a5af4cf1a62b22fb0e19d9-d9ef2.jpg 225w,\n/static/balsa-boat-dd681df416a5af4cf1a62b22fb0e19d9-ac97c.jpg 450w,\n/static/balsa-boat-dd681df416a5af4cf1a62b22fb0e19d9-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The Isla Captial had a shop and a restaurant, with some signs about where we couldn’t walk. The guide explained that every footstep causes the islands to sink a little bit which means that more reeds need to be placed and repairs made. It seemed that Uros people had a tough job of balancing tourism and the maintenance of the island itself.</p>\n<h2>Bolivia Hop</h2>\n<p>We opted for <a href="https://www.boliviahop.com/">Bolivia Hop</a> due to the convenience of having everything sorted with minimal effort, but with hindsight we wish we had just sorted it ourselves. The La Paz to Puno leg of the journey seemed OK and was efficient, including the crossing of the Tiquina Lake. However, the overnight journey from Puno to Arequipa was particularly uncomfortable. The bus was absolutely boiling, there was limited leg room and the jerky driving led to a terrible night sleep.</p>\n<h2>Our Verdict on Lake Titicaca</h2>\n<p>We had a pleasant few days at Lake Titicaca and enjoyed our rest in the surroundings, particularly after coming out of the busy La Paz. The highlight was undoubtably the unusual Islas Flotantes De Los Uros.</p>',frontmatter:{title:"Lake Titicaca, Bolivia",date:"April 29, 2018",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.7777777777777777,src:"/static/isla-del-sol-e6ef7e462de9052044efffc739166bd1-47774.jpg",srcSet:"/static/isla-del-sol-e6ef7e462de9052044efffc739166bd1-45ad6.jpg 480w,\n/static/isla-del-sol-e6ef7e462de9052044efffc739166bd1-e2fcf.jpg 960w,\n/static/isla-del-sol-e6ef7e462de9052044efffc739166bd1-47774.jpg 1920w",sizes:"(max-width: 1920px) 100vw, 1920px"}}}}}},pathContext:{slug:"/lake-titicaca/",previous:{fields:{slug:"/la-paz/"},frontmatter:{title:"La Paz, Bolivia"}},next:{fields:{slug:"/arequipa/"},frontmatter:{title:"Arequipa, Peru"}}}}}});
